import actionTypes from '../actionTypes'

const initialState = {
    userInfo: {}
}

const initLoadReducer = (state = initialState, action) => {
    let userName = state.userInfo;
    switch (action.type) {
        case actionTypes.FEATCH_USER_NAME_OK:
            return { ...state, userInfo:action.data };
        default:
            return state;
    }
}

export default initLoadReducer;
